import React, { Fragment, useState } from "react";
import './mainNavigation.css'
import facebook from '../../facebook.png'
import { HomeOutlined, PeopleOutlined, SettingsOutlined } from "@mui/icons-material";
import { useSelector } from "react-redux";
import { resourceEndPoint } from "../../API/apiEndpoint";
import { useNavigate } from "react-router-dom";
import { Dropdown } from "react-bootstrap";

const MainNavigation = (props:any) => {
    let navigate = useNavigate()
    const [show,setShow] = useState(false)
    const userData = useSelector((state:any) => state.auth.userData)
    const CustomToggle:any = React.forwardRef(({ children, onClick }:any, ref):any => (
        <SettingsOutlined
          onClick={(e) => {
            e.preventDefault();
            onClick(e);
          }}
        >
          {children}
          &#x25bc;
        </SettingsOutlined>
      ));
    return (
       <Fragment>
        <div className="mainNavigation-container">
            <div className="mainNavigation-container__img"><img src={facebook}></img></div>
            <div className="mainNavigation__stack">
                <div onClick={() => navigate('/home',{replace:false})} className="mainNavigation__stack-element" >
                <HomeOutlined/>
                </div>
                <div onClick={() => navigate('/myProfile',{replace:false})} className="mainNavigation__stack-element" >
                <img src={resourceEndPoint + `/${userData.ProfilePic}`}></img>
                </div>
                <div onClick={() => navigate('/friends',{replace:false})} className="mainNavigation__stack-element" >
                <PeopleOutlined/>
                </div>
            </div>
            <div className="mainNavigation__stack-element" >
            <Dropdown>
    <Dropdown.Toggle as={CustomToggle} id="dropdown-custom-components">
      Custom toggle
    </Dropdown.Toggle>

    <Dropdown.Menu>
      <Dropdown.Item eventKey="1">Red</Dropdown.Item>
    </Dropdown.Menu>
  </Dropdown>
            </div>
        </div>
        <main>{props.children}</main>
       </Fragment>
    )
}
export default MainNavigation
